import React from 'react';
import Dashboard from './Components/Dashboard/Admin';
import DashboardTable from './Components/Tables/SampleData';
import { Routes, Route } from "react-router-dom";
import { useSelector, useDispatch } from 'react-redux';
import { increment, decrement } from './Components/actions';


function App() {
  const counter = useSelector(state => state.counter);
  const loggedIn = useSelector(state => state.loggedIn);
  const dispatch = useDispatch();


  return (
    <div className="App">
      <Dashboard />
      <h1>Counter {counter}</h1>
      <button onClick={() => dispatch(increment())}>+</button>
      <button onClick={() => dispatch(decrement())}>-</button>
      {loggedIn ? <DashboardTable />: '' }
      {/* <Routes>
        <Route path="/" element={<Dashboard />} />
        <Route path="Table" element={<DashboardTable />} />
      </Routes> */}
    </div>
  );
}

export default App;
